;; **
;;; Load the data exported from Mathematica.
;; **

;; @@
(def dat (mapv #(vector (first %))
               (csv/slurp-csv "data/mma_double.csv"
                              :header false
                              :cast-fns {0 #(Double/parseDouble %) 1 #(Double/parseDouble %)})))
(def t-step 0.1)
